import React, { useEffect,useState } from 'react'
import {connect} from 'react-redux'
import * as actions from '../actions/dCandidate'
import { Container, Grid,Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@material-ui/core'
import DCandidateForm from './DCandidateForm'


/*export default function DCandidates(props) {
  return (
    <div>from DCandidates</div>
  )
}*/

const DCandidates = (props) =>
  {
    useEffect((props)=>{
      props.fetchAllDCandidates()
    },[])


    return (
      <Paper>
        <Grid container>
            <Grid item xs={6}>
              <DCandidateForm></DCandidateForm>
            </Grid>
            <Grid item xs={6}>
              <TableContainer>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Name</TableCell>
                            <TableCell>Mobile</TableCell>
                            <TableCell>Blood Group</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                       {
                         props.dCandidateList.map((record,index) => {
                           return(
                            <TableRow key={index}>
                                <TableCell>{record.fullName}</TableCell>
                            </TableRow>
                           )
                         })
                       }
                    </TableBody>
                </Table>
              </TableContainer>
            </Grid>
        </Grid>
      </Paper>
    )
  }

const mapStateToProps = state => (
  {
    dCandidateList : state.dCandidate.list
  }  
)

const mapActionsToProps =   {
  fetchAllDCandidates : actions.fetchall
}

export default  connect(mapStateToProps,mapActionsToProps)(DCandidates)
